import React, { useState } from 'react'
import ReactStars from "react-rating-stars-component";
function Cards() {
    const [data, Setdata] = useState([
        {
            name: "Avengers",
            year: "2020",
            Rating: 3.5,
            Img: "https://th.bing.com/th/id/OIP.oL8HzdJT37s55zyqV6m18QHaK8?w=205&h=303&c=7&r=0&o=5&pid=1.7"

        },
        {
            name: "Avengers",
            year: "2020",
            Rating: 4.5,
            Img: "https://th.bing.com/th/id/OIP.oL8HzdJT37s55zyqV6m18QHaK8?w=205&h=303&c=7&r=0&o=5&pid=1.7"

        },
        {
