        },
        {
            name: "Avengers",
            year: "2020",
            Rating: 5,
            Img: "https://th.bing.com/th/id/OIP.oL8HzdJT37s55zyqV6m18QHaK8?w=205&h=303&c=7&r=0&o=5&pid=1.7"

        },
        {
            name: "Avengers",
            year: "2020",
            Rating: 5,
            Img: "https://th.bing.com/th/id/OIP.oL8HzdJT37s55zyqV6m18QHaK8?w=205&h=303&c=7&r=0&o=5&pid=1.7"

        },
        {
            name: "Avengers",
            year: "2020",
            Rating: 5,
            Img: "https://th.bing.com/th/id/OIP.oL8HzdJT37s55zyqV6m18QHaK8?w=205&h=303&c=7&r=0&o=5&pid=1.7"

        }
    ]);
    return (
        <div className='flex flex-wrap justify-between p-3 mt-2'>
            {data.map((e, i) => {
                return (
                    <div key={i} className="card shadow-lg font-medium p-2 hover:-translate-y-2 cursor-pointer">
                        <img className="h-72" src={e.Img} />
                        <h1><span className='text-gray-500'>Name : </span>{e.name} </h1>
                        <h1>Rating:
                        <ReactStars 
                        size={20} 
                        half={true}
                        value={e.Rating}
                        edit={false}
                        /></h1>
                        <h1><span className='text-gray-500'>Year : </span>{e.year}</h1>
                    </div>
                )
            })}
        </div>
    )
}

export default Cards
